contracts/aiQuiz.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Course {
    struct Quiz {
        string question;
        string[4] answers;
        uint8 correctAnswer; // 1, 2, 3, or 4
    }

    struct CourseInfo {
        string name;
        address owner;
        uint256 startDate;
        uint256 finishDate;
        string imageIPFS;
        string description;
        uint256 rewardAmount;
    }

    CourseInfo public course;
    Quiz[] public quizzes;

    mapping(address => bool) public hasAnswered;
    mapping(address => uint256) public correctAnswers;

    address[] public participants;

    constructor(
        string memory _name,
        uint256 _startDate,
        uint256 _finishDate,
        string memory _imageIPFS,
        string memory _description
    ) payable {
        require(msg.value > 0, "Reward amount must be greater than 0");

        course = CourseInfo({
            name: _name,
            owner: msg.sender,
            startDate: _startDate,
            finishDate: _finishDate,
            imageIPFS: _imageIPFS,
            description: _description,
            rewardAmount: msg.value
        });
    }

    modifier onlyOwner() {
        require(msg.sender == course.owner, "Only owner can perform this action");
        _;
    }

    modifier courseActive() {
        require(block.timestamp >= course.startDate && block.timestamp <= course.finishDate, "Course is not active");
        _;
    }

    modifier courseEnded() {
        require(block.timestamp > course.finishDate, "Course is still active");
        _;
    }

    function addQuiz(string memory _question, string[4] memory _answers, uint8 _correctAnswer) public onlyOwner courseActive {
        require(_correctAnswer >= 1 && _correctAnswer <= 4, "Correct answer must be between 1 and 4");
        quizzes.push(Quiz({
            question: _question,
            answers: _answers,
            correctAnswer: _correctAnswer
        }));
    }

    function answerQuiz(uint8[] memory _answers) public courseActive {
        require(!hasAnswered[msg.sender], "You have already answered");
        require(_answers.length == quizzes.length, "Must answer all quizzes");

        uint256 correctCount = 0;

        for (uint256 i = 0; i < quizzes.length; i++) {
            if (_answers[i] == quizzes[i].correctAnswer) {
                correctCount++;
            }
        }

        hasAnswered[msg.sender] = true;
        correctAnswers[msg.sender] = correctCount;
        participants.push(msg.sender);
    }

    function claimReward() public courseEnded {
        require(hasAnswered[msg.sender], "You did not participate");
        require(correctAnswers[msg.sender] > 0, "No correct answers");

        uint256 totalCorrectAnswers = 0;
        for (uint256 i = 0; i < participants.length; i++) {
            totalCorrectAnswers += correctAnswers[participants[i]];
        }

        uint256 reward = (course.rewardAmount * correctAnswers[msg.sender]) / totalCorrectAnswers;
        payable(msg.sender).transfer(reward);
    }

    function withdraw() public onlyOwner courseEnded {
        payable(course.owner).transfer(address(this).balance);
    }

    // New Getter Functions

    // Get course information
    function getCourse() public view returns (string memory, address, uint256, uint256, string memory, string memory, uint256) {
        return (
            course.name,
            course.owner,
            course.startDate,
            course.finishDate,
            course.imageIPFS,
            course.description,
            course.rewardAmount
        );
    }

    // Get a specific quiz by its index
    function getQuizByIndex(uint256 index) public view returns (string memory, string[4] memory, uint8) {
        require(index < quizzes.length, "Quiz index out of bounds");

        Quiz memory quiz = quizzes[index];
        return (
            quiz.question,
            quiz.answers,
            quiz.correctAnswer
        );
    }

    // Get all quizzes
    function getQuizzes() public view returns (Quiz[] memory) {
        return quizzes;
    }
}

